pub enum ResolutionError {

    /// Success
    Success = ,

    /// Authoritative Answer "Host not found"
    HostNotFound = ,

    /// Non-Authoritative "Host not found" or SERVERFAIL.
    TryAgain = ,

    /// Non recoverable errors, FORMERR, REFUSED, NOTIMP.
    NoRecovery = ,

    /// Valid name, no data record of requested type.
    NoData = ,
}

pub enum Error {

    /// Name Resolution failed
    Resolver(ResolutionError),

    /// String contains null bytes
    CString(NulError),

    /// Stirng contains null bytes
    CStr(FromBytesWithNulError),

    /// Name service response does not parse
    ParseError,

    /// Section/Index is out of bounds
    NoSuchSectionIndex(Section, usize),

    /// Uncompress Error
    UncompressError,

    /// Result from dn_expand was not null terminated
    Unterminated,

    /// Wrong Resource record type
    WrongRRType,

    /// String is not valid UTF-8
    Utf8(Utf8Error),

    /// Unknown class
    UnknownClass(u16),
}

pub enum Class {

    /// Internet Class.  By far the most common.
    IN = ,

    /// CSNET class (obsoleted)
    CSNET = ,

    /// CHAOS class (https://en.wikipedia.org/wiki/Chaosnet)
    CHAOS = ,

    /// Hesoid (https://en.wikipedia.org/wiki/Hesiod_(name_service))
    HS = ,

    /// None.  Used for "name is not in use" requests.
    NONE = ,

    /// Any.  Used for "name is in use" requests.
    ANY = ,
}

