    Init = ,

    /// print debug messages
    Debug = ,

    /// use virtual circuit
    UseVC = ,

    /// ignore truncation errors
    IgnTc = ,

    /// recursion desired
    Recurse = ,

    /// use default domain name
    DefNames = ,

    /// Keep TCP socket open
    StayOpen = ,

    /// search up local domain tree
    DNSrch = ,

    /// shuts off HOSTALIASES feature
